/* eslint-disable */module.exports = { languageData: { "plurals": function (n, ord) { var s = String(n).split("."), t0 = Number(s[0]) == n, n100 = t0 && s[0].slice(-2); if (ord) return "other"; return n == 0 ? "zero" : n == 1 ? "one" : n == 2 ? "two" : n100 >= 3 && n100 <= 10 ? "few" : n100 >= 11 && n100 <= 99 ? "many" : "other" } }, messages: { "ABOUT THE APP": "\u0646\u0628\u0630\u0629 \u0639\u0646 \u0627\u0644\u062A\u0637\u0628\u064A\u0642", "About Arrival Advisor": "\u0646\u0628\u0630\u0629 \u0639\u0646 Arrival Advisor", "An error has occured.": "\u062D\u062F\u062B \u062E\u0637\u0623.", "Answer a few optional questions to get tailored recommendations for your needs.": "\u0623\u062C\u0628 \u0639\u0644\u0649 \u0628\u0636\u0639 \u0623\u0633\u0626\u0644\u0629 \u0627\u062E\u062A\u064A\u0627\u0631\u064A\u0629 \u0648\u0627\u062D\u0635\u0644 \u0639\u0644\u0649 \u0642\u0627\u0626\u0645\u0629 \u0645\u062E\u0635\u0635\u0629 \u0628\u0627\u0644\u0645\u0648\u0636\u0648\u0639\u0627\u062A \u0627\u0644\u062A\u064A \u0646\u0648\u0635\u064A \u0628\u0647\u0627.", "Answer a few questions about your situation to get personalized recommendations of topics and services to help you settle in British Columbia.": "\u0623\u062C\u0628 \u0639\u0646 \u0628\u0636\u0639 \u0623\u0633\u0626\u0644\u0629 \u062A\u062A\u0639\u0644\u0642 \u0628\u0645\u0648\u0642\u0641\u0643 \u0643\u064A \u062A\u062D\u0635\u0644 \u0639\u0644\u0649 \u062A\u0648\u0635\u064A\u0627\u062A \u0645\u062E\u0635\u0635\u0629 \u0628\u0627\u0644\u0645\u0648\u0636\u0648\u0639\u0627\u062A \u0648\u0627\u0644\u062E\u062F\u0645\u0627\u062A \u0627\u0644\u062A\u064A \u062A\u0633\u0627\u0639\u062F\u0643 \u0641\u064A \u0627\u0644\u0627\u0633\u062A\u0642\u0631\u0627\u0631 \u0641\u064A \u0628\u0631\u064A\u062A\u064A\u0634 \u0643\u0648\u0644\u0648\u0645\u0628\u064A\u0627.", "Answer questions": "\u0623\u062C\u0628 \u0639\u0646 \u0627\u0644\u0623\u0633\u0626\u0644\u0629", "Arrival Advisor contains information from the BC Government\u2019s Newcomer\u2019s Guide, available at <0>www.welcomebc.ca</0>, and the BC211 database of service providers, available at <1>www.bc211.ca</1>.": "\u064A\u062D\u062A\u0648\u064A \u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u0639\u0644\u0649 \u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0645\u0646 \u062F\u0644\u064A\u0644 \u0627\u0644\u0642\u0627\u062F\u0645\u064A\u0646 \u0627\u0644\u062C\u062F\u062F \u0627\u0644\u0635\u0627\u062F\u0631 \u0639\u0646 \u062D\u0643\u0648\u0645\u0629 \u0628\u0631\u064A\u062A\u064A\u0634 \u0643\u0648\u0644\u0648\u0645\u0628\u064A\u0627 \u0648\u0647\u0648 \u0645\u062A\u0627\u062D \u0639\u0644\u0649 \u0627\u0644\u0645\u0648\u0642\u0639: <0>www.welcomebc.ca</0>\u060C \u0648\u0643\u0630\u0644\u0643 \u0642\u0627\u0639\u062F\u0629 \u0628\u064A\u0627\u0646\u0627\u062A BC211 \u0644\u0645\u0632\u0648\u062F\u064A \u0627\u0644\u062E\u062F\u0645\u0627\u062A \u0627\u0644\u0645\u062A\u0627\u062D\u0629 \u0639\u0644\u0649 \u0627\u0644\u0645\u0648\u0642\u0639: <1>www.bc211.ca</1>.", "Arrival Advisor is a free, multilingual, mobile app that helps immigrants and refugees in British Columbia, Canada find information and services to navigate their settlement journey. Arrival Advisor is offered in English, Arabic, Chinese Simplified, Chinese Traditional, French (Canadian), Korean, Punjabi, and Tagalog.": "\u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u0647\u0648 \u062A\u0637\u0628\u064A\u0642 \u0645\u062C\u0627\u0646\u064A \u0645\u062A\u0639\u062F\u062F \u0627\u0644\u0644\u063A\u0627\u062A \u0644\u0644\u0623\u062C\u0647\u0632\u0629 \u0627\u0644\u0645\u062D\u0645\u0648\u0644\u0629 \u064A\u0633\u0627\u0639\u062F \u0627\u0644\u0645\u0647\u0627\u062C\u0631\u064A\u0646 \u0648\u0627\u0644\u0644\u0627\u062C\u0626\u064A\u0646 \u0641\u064A \u0625\u0642\u0644\u064A\u0645 \u0628\u0631\u064A\u062A\u064A\u0634 \u0643\u0648\u0644\u0648\u0645\u0628\u064A\u0627 \u0641\u064A \u0643\u0646\u062F\u0627 \u0639\u0644\u0649 \u0627\u0644\u0628\u062D\u062B \u0639\u0646 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0648\u0627\u0644\u062E\u062F\u0645\u0627\u062A \u0627\u0644\u062A\u064A \u062A\u0648\u062C\u0647\u0647\u0645 \u0641\u064A \u0633\u0639\u064A\u0647\u0645 \u0646\u062D\u0648 \u0627\u0644\u0627\u0633\u062A\u0642\u0631\u0627\u0631. \u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u0645\u062A\u0648\u0641\u0631 \u062D\u0627\u0644\u064A\u0627 \u0628\u0627\u0644\u0644\u063A\u0627\u062A \u0627\u0644\u0625\u0646\u0643\u0644\u064A\u0632\u064A\u0629 \u0648\u0627\u0644\u0639\u0631\u0628\u064A\u0629 \u0648\u0627\u0644\u0635\u064A\u0646\u064A\u0629 \u0627\u0644\u0645\u0628\u0633\u0637\u0629 \u0648\u0627\u0644\u0635\u064A\u0646\u064A\u0629 \u0627\u0644\u062A\u0642\u0644\u064A\u062F\u064A\u0629 \u0648\u0627\u0644\u0641\u0631\u0646\u0633\u064A\u0629 (\u0643\u0646\u062F\u0627) \u0648\u0627\u0644\u0643\u0648\u0631\u064A\u0629 \u0648\u0627\u0644\u0628\u0646\u062C\u0627\u0628\u064A\u0629 \u0648\u0627\u0644\u062A\u0627\u063A\u0644\u0648\u063A\u064A\u0629.", "Arrival Advisor is your go-to guide to getting settled in your new community.": "\u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u0647\u0648 \u062F\u0644\u064A\u0644\u0643 \u0627\u0644\u0645\u0641\u0636\u0644 \u0641\u064A \u0631\u062D\u0644\u062A\u0643 \u0646\u062D\u0648 \u0627\u0644\u0625\u0633\u062A\u0642\u0631\u0627\u0631 \u0641\u064A \u0645\u062C\u062A\u0645\u0639\u0643 \u0627\u0644\u062C\u062F\u064A\u062F.", "Arrival Advisor respects and maintains the privacy and anonymity of its users. Users do not need to provide personal information in order to use the app. The questionnaire is designed to assist in personalizing services and resources required by the user, and answers are only saved to enhance the usability of the app over time. Users of the Arrival Advisor app do so at their own discretion. The answers you provide will be used for the operation of this tool to provide you with guidance on resources and services that can help you adjust to life in Canada. Users cannot be identified by their answers to the questionnaire. The information is not used by Immigration, Refugees and Citizenship Canada for any other purpose and is not used for any immigration decision making.": "\u064A\u062D\u062A\u0631\u0645 \u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u0648\u064A\u0635\u0648\u0646 \u062E\u0635\u0648\u0635\u064A\u0629 \u0627\u0644\u0645\u0633\u062A\u062E\u062F\u0645\u064A\u0646 \u0648\u0628\u064A\u0627\u0646\u0627\u062A\u0647\u0645. \u0644\u0627 \u064A\u062D\u062A\u0627\u062C \u0627\u0644\u0645\u0633\u062A\u062E\u062F\u0645\u064A\u0646 \u0644\u062A\u0642\u062F\u064A\u0645 \u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0634\u062E\u0635\u064A\u0629 \u0643\u064A \u064A\u0633\u062A\u062E\u062F\u0645\u0648\u0627 \u0627\u0644\u062A\u0637\u0628\u064A\u0642. \u0635\u0645\u0645 \u0627\u0644\u0627\u0633\u062A\u0628\u064A\u0627\u0646 \u0643\u064A \u064A\u0633\u0627\u0639\u062F \u0641\u064A \u062A\u062E\u0635\u064A\u0635 \u0627\u0644\u062E\u062F\u0645\u0627\u062A \u0648\u0627\u0644\u0645\u0648\u0627\u0631\u062F \u0627\u0644\u062A\u064A \u064A\u062D\u062A\u0627\u062C\u0647\u0627 \u0627\u0644\u0645\u0633\u062A\u062E\u062F\u0645 \u0648\u062A\u062D\u0641\u0638 \u0627\u0644\u0625\u062C\u0627\u0628\u0627\u062A \u0641\u0642\u0637 \u0628\u063A\u0631\u0636 \u062A\u062D\u0633\u064A\u0646 \u0645\u0633\u062A\u0648\u0649 \u0627\u0633\u062A\u062E\u062F\u0627\u0645 \u0627\u0644\u062A\u0637\u0628\u064A\u0642 \u0628\u0645\u0631\u0648\u0631 \u0627\u0644\u0648\u0642\u062A. \u064A\u0641\u0639\u0644 \u0645\u0633\u062A\u062E\u062F\u0645\u0648 \u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u0630\u0644\u0643 \u0628\u0645\u062D\u0636 \u0625\u0631\u0627\u062F\u062A\u0647\u0645. \u0633\u0648\u0641 \u062A\u0633\u062A\u062E\u062F\u0645 \u0627\u0644\u0625\u062C\u0627\u0628\u0627\u062A \u0627\u0644\u062A\u064A \u062A\u0642\u062F\u0645\u0647\u0627 \u0644\u062A\u0634\u063A\u064A\u0644 \u0647\u0630\u0647 \u0627\u0644\u0623\u062F\u0627\u0629 \u0644\u062A\u0642\u062F\u0645 \u0644\u0643 \u062A\u0648\u062C\u064A\u0647\u0627\u062A \u062A\u062A\u0639\u0644\u0642 \u0628\u0627\u0644\u0645\u0648\u0627\u0631\u062F \u0648\u0627\u0644\u062E\u062F\u0645\u0627\u062A \u0627\u0644\u062A\u064A \u0642\u062F \u062A\u0633\u0627\u0639\u062F\u0643 \u0641\u064A \u0627\u0644\u062A\u0623\u0642\u0644\u0645 \u062F\u0627\u062E\u0644 \u0643\u0646\u062F\u0627. \u0644\u0627 \u064A\u0645\u0643\u0646 \u062A\u062D\u062F\u064A\u062F \u0647\u0648\u064A\u0629 \u0627\u0644\u0645\u0633\u062A\u062E\u062F\u0645\u064A\u0646 \u0628\u0627\u0633\u062A\u062E\u062F\u0627\u0645 \u0625\u062C\u0627\u0628\u0627\u062A\u0647\u0645 \u0639\u0644\u0649 \u0627\u0644\u0627\u0633\u062A\u0628\u064A\u0627\u0646. \u0644\u0627 \u062A\u0633\u062A\u062E\u062F\u0645 \u0648\u0632\u0627\u0631\u0629 \u0627\u0644\u0647\u062C\u0631\u0629 \u0648\u0627\u0644\u0644\u0627\u062C\u0626\u064A\u0646 \u0648\u0627\u0644\u062C\u0646\u0633\u064A\u0629 \u0627\u0644\u0643\u0646\u062F\u064A\u0629 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0644\u0623\u064A \u063A\u0631\u0636 \u0622\u062E\u0631 \u0643\u0645\u0627 \u0623\u0646\u0647\u0627 \u0644\u0627 \u062A\u0633\u062A\u062E\u062F\u0645 \u0641\u064A \u0627\u062A\u062E\u0627\u0630 \u0623\u064A \u0642\u0631\u0627\u0631 \u064A\u062A\u0639\u0644\u0642 \u0628\u0627\u0644\u0647\u062C\u0631\u0629.", "Back": "\u0631\u062C\u0648\u0639", "Based on your answers, we recommend these topics for you:": "\u0627\u0633\u062A\u0646\u0627\u062F\u0627 \u0625\u0644\u0649 \u0625\u062C\u0627\u0628\u0627\u062A\u0643\u060C \u0646\u0648\u0635\u064A \u0628\u0647\u0630\u0647 \u0627\u0644\u0645\u0648\u0636\u0648\u0639\u0627\u062A \u0625\u0644\u064A\u0643:", "Bookmark added": "\u0623\u0636\u0641\u0646\u0627 \u0627\u0644\u0639\u0644\u0627\u0645\u0629 \u0627\u0644\u0645\u0631\u062C\u0639\u064A\u0629", "Bookmark removed": "\u0645\u062D\u0648\u0646\u0627 \u0627\u0644\u0639\u0644\u0627\u0645\u0629 \u0627\u0644\u0645\u0631\u062C\u0639\u064A\u0629", "Bookmark the topics that you find helpful for future use.": "\u0642\u0645 \u0628\u0627\u0644\u062A\u0639\u0644\u064A\u0645 \u0639\u0644\u0649 \u0627\u0644\u0645\u0648\u0636\u0648\u0639\u0627\u062A \u0627\u0644\u062A\u064A \u062A\u062C\u062F\u0647\u0627 \u0645\u0641\u064A\u062F\u0629 \u0643\u064A \u062A\u0631\u062C\u0639 \u0625\u0644\u064A\u0647\u0627 \u0641\u064A \u0648\u0642\u062A \u0644\u0627\u062D\u0642.", "Contact Arrival Advisor team": "\u062A\u0648\u0627\u0635\u0644 \u0645\u0639 \u0641\u0631\u064A\u0642 Arrival Advisor", "Created by": "\u0635\u0645\u0645\u062A\u0647", "Delete all user data": "\u062D\u0630\u0641 \u062C\u0645\u064A\u0639 \u0628\u064A\u0627\u0646\u0627\u062A \u0627\u0644\u0645\u0633\u062A\u062E\u062F\u0645", "Disclaimer": "\u0625\u062E\u0644\u0627\u0621 \u0645\u0633\u0624\u0648\u0644\u064A\u0629", "Done": "\u0627\u0646\u062A\u0647\u0649", "EXPLORE TOPICS": "\u062A\u0635\u0641\u062D \u0627\u0644\u0645\u0648\u0636\u0648\u0639\u0627\u062A", "FOR ADDITIONAL ASSISTANCE": "\u0644\u0644\u0645\u0632\u064A\u062F \u0645\u0646 \u0627\u0644\u0645\u0633\u0627\u0639\u062F\u0629.", "Fetching your location timed out. On Android devices you may need to set your location mode to \"High accuracy\".": "\u0627\u0633\u062A\u063A\u0631\u0642 \u062A\u062D\u062F\u064A\u062F \u0645\u0648\u0642\u0639\u0643 \u0623\u0643\u062B\u0631 \u0645\u0646 \u0627\u0644\u0644\u0627\u0632\u0645. \u0642\u062F \u062A\u062D\u062A\u0627\u062C \u0625\u0644\u0649 \u0636\u0628\u0637 \u0648\u0636\u0639 \u062A\u062D\u062F\u064A\u062F \u0627\u0644\u0645\u0648\u0642\u0639 \u0625\u0644\u0649 \xAB\u062F\u0642\u0629 \u0634\u062F\u064A\u062F\u0629\xBB \u0639\u0644\u0649 \u0623\u062C\u0647\u0632\u0629 \u0623\u0646\u062F\u0631\u0648\u064A\u062F.", "Find a settlement agency near me": "\u0627\u0628\u062D\u062B \u0639\u0646 \u0648\u0643\u0627\u0644\u0629 \u0627\u0633\u062A\u0642\u0631\u0627\u0631 \u0642\u0631\u064A\u0628\u0629 \u0645\u0646.", "Find related services near me": "\u0627\u0628\u062D\u062B \u0639\u0646 \u062E\u062F\u0645\u0627\u062A \u0630\u0627\u062A \u0635\u0644\u0629 \u0628\u0627\u0644\u0642\u0631\u0628 \u0645\u0646\u064A", "Find service providers near you that can help you through your settlement journey.": "\u0627\u0628\u062D\u062B \u0639\u0646 \u0627\u0644\u062E\u062F\u0645\u0627\u062A \u0627\u0644\u0642\u0631\u064A\u0628\u0629 \u0627\u0644\u062A\u064A \u064A\u0645\u0643\u0646\u0647\u0627 \u0645\u0633\u0627\u0639\u062F\u062A\u0643 \u0641\u064A \u0631\u062D\u0644\u062A\u0643 \u0644\u0644\u0625\u0633\u062A\u0642\u0631\u0627\u0631.", "From finding a job to learning English, accessing health care, and more, Arrival Advisor has everything you need to get started in your new community. Explore topics and services without ever needing to create an account. Access important information no matter where you are: the newcomer topics provided by Arrival Advisor are saved to your phone so you can view them, even without internet. You can fill out some questions to get personalized recommendations of topics and services to settle in British Columbia. Arrival Advisor is anonymous and your answers are only used to operate the app's recommendations. We never save or share your personal data with funders or any third parties.": "\u0633\u0648\u0627\u0621 \u0643\u0646\u062A \u062A\u0628\u062D\u062B \u0639\u0646 \u0648\u0638\u064A\u0641\u0629 \u0623\u0648 \u062A\u0639\u0644\u0645 \u0627\u0644\u0644\u063A\u0629 \u0627\u0644\u0625\u0646\u0643\u0644\u064A\u0632\u064A\u0629 \u0623\u0648 \u0627\u0644\u062D\u0635\u0648\u0644 \u0639\u0644\u0649 \u0627\u0644\u0631\u0639\u0627\u064A\u0629 \u0627\u0644\u0635\u062D\u064A\u0629 \u0648\u063A\u064A\u0631\u0647\u0627\u060C \u064A\u062C\u0645\u0639 \u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u0643\u0644 \u0634\u064A\u0621 \u062A\u062D\u062A\u0627\u062C \u0625\u0644\u064A\u0647 \u0643\u064A \u062A\u0628\u062F\u0623 \u062D\u064A\u0627\u062A\u0643 \u0641\u064A \u0645\u062C\u062A\u0645\u0639\u0643 \u0627\u0644\u062C\u062F\u064A\u062F. \u0627\u0633\u062A\u0643\u0634\u0641 \u0645\u0648\u0627\u0636\u064A\u0639 \u0648\u062E\u062F\u0645\u0627\u062A \u062F\u0648\u0646 \u0627\u0644\u062D\u0627\u062C\u0629 \u0644\u0625\u0646\u0634\u0627\u0621 \u062D\u0633\u0627\u0628. \u0623\u062D\u0635\u0644 \u0639\u0644\u0649 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0627\u0644\u0647\u0627\u0645\u0629 \u0628\u063A\u0636 \u0627\u0644\u0646\u0638\u0631 \u0639\u0646 \u0645\u0643\u0627\u0646\u0643 \u062D\u064A\u062B \u0623\u0646 \u0627\u0644\u0645\u0648\u0627\u0636\u064A\u0639 \u0627\u0644\u062E\u0627\u0635\u0629 \u0628\u0627\u0644\u0642\u0627\u062F\u0645\u064A\u0646 \u0627\u0644\u062C\u062F\u062F \u0627\u0644\u062A\u064A \u064A\u0642\u062F\u0645\u0647\u0627 \u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u062A\u062D\u0641\u0638 \u0639\u0644\u0649 \u0647\u0627\u062A\u0641\u0643 \u062D\u062A\u0649 \u064A\u0645\u0643\u0646\u0643 \u0627\u0633\u062A\u0639\u0631\u0627\u0636\u0647\u0627 \u062F\u0648\u0646 \u0627\u0644\u062D\u0627\u062C\u0629 \u0644\u0644\u0627\u062A\u0635\u0627\u0644 \u0628\u0627\u0644\u0625\u0646\u062A\u0631\u0646\u062A. \u064A\u0645\u0643\u0646\u0643 \u0623\u064A\u0636\u0627 \u0627\u0644\u0625\u062C\u0627\u0628\u0629 \u0639\u0644\u0649 \u0628\u0639\u0636 \u0627\u0644\u0623\u0633\u0626\u0644\u0629 \u0643\u064A \u062A\u062D\u0635\u0644 \u0639\u0644\u0649 \u062A\u0648\u0635\u064A\u0627\u062A \u0645\u062E\u0635\u0635\u0629 \u0628\u0627\u0644\u0645\u0648\u0627\u0636\u064A\u0639 \u0648\u0627\u0644\u062E\u062F\u0645\u0627\u062A \u0627\u0644\u0645\u062A\u0639\u0644\u0642\u0629 \u0628\u0627\u0644\u0627\u0633\u062A\u0642\u0631\u0627\u0631 \u0641\u064A \u0628\u0631\u064A\u062A\u0634 \u0643\u0648\u0644\u0648\u0645\u0628\u064A\u0627. \u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u0644\u0627 \u064A\u0633\u062C\u0644 \u0628\u064A\u0627\u0646\u0627\u062A\u0643 \u0623\u0648 \u064A\u0634\u0627\u0631\u0643\u0647\u0627 \u0648\u0633\u062A\u0633\u062A\u062E\u062F\u0645 \u0625\u062C\u0627\u0628\u0627\u062A\u0643 \u0641\u0642\u0637 \u0641\u064A \u0639\u0631\u0636 \u062A\u0648\u0635\u064A\u0627\u062A \u0627\u0644\u062A\u0637\u0628\u064A\u0642. \u0646\u062D\u0646 \u0644\u0627 \u0646\u062D\u0641\u0638 \u0623\u0648 \u0646\u0634\u0627\u0631\u0643 \u0645\u0637\u0644\u0642\u0627 \u0628\u064A\u0627\u0646\u0627\u062A\u0643 \u0627\u0644\u0634\u062E\u0635\u064A\u0629 \u0645\u0639 \u0627\u0644\u062C\u0647\u0627\u062A \u0627\u0644\u0645\u0645\u0648\u0644\u0629 \u0623\u0648 \u0627\u0644\u063A\u064A\u0631.", "GETTING STARTED": "\u0628\u062F\u0621 \u0627\u0644\u0627\u0633\u062A\u062E\u062F\u0627\u0645", "Get information based on your needs": "\u0623\u062D\u0635\u0644 \u0639\u0644\u0649 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0627\u0633\u062A\u0646\u0627\u062F\u0627 \u0625\u0644\u0649 \u0627\u062D\u062A\u064A\u0627\u062C\u0627\u062A\u0643", "Go back to questions": "\u0627\u0644\u0639\u0648\u062F\u0629 \u0625\u0644\u0649 \u0627\u0644\u0623\u0633\u0626\u0644\u0629", "Help & Support": "\u0644\u0644\u0645\u0633\u0627\u0639\u062F\u0629 \u0648\u0627\u0644\u062F\u0639\u0645", "If you are having difficulty with settlement in Canada, we suggest getting in touch with a settlement worker.": "\u0644\u0648 \u0643\u0646\u062A \u062A\u0648\u0627\u062C\u0647 \u0645\u0635\u0627\u0639\u0628 \u0641\u064A \u0627\u0644\u0627\u0633\u062A\u0642\u0631\u0627\u0631 \u062F\u0627\u062E\u0644 \u0643\u0646\u062F\u0627\u060C \u0646\u0642\u062A\u0631\u062D \u0639\u0644\u064A\u0643 \u0623\u0646 \u062A\u062A\u0648\u0627\u0635\u0644 \u0645\u0639 \u0645\u0648\u0638\u0641 \u0627\u0633\u062A\u0642\u0631\u0627\u0631.", "Information in this app is provided by the <0>Newcomers Guide to British Columbia</0> Copyright 2018 Province of British Columbia. All rights reserved.": "\u0642\u062F\u0645 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0627\u0644\u0645\u0628\u064A\u0646\u0629 \u0641\u064A \u0647\u0630\u0627 \u0627\u0644\u062A\u0637\u0628\u064A\u0642 \u0645\u0648\u0642\u0639 <0>Newcomers Guide to British Columbia</0> \u062D\u0642\u0648\u0642 \u0627\u0644\u0637\u0628\u0639 2018 \u062A\u0631\u062C\u0639 \u0625\u0644\u0649 \u0645\u0642\u0627\u0637\u0639\u0629 \u0628\u0631\u064A\u062A\u064A\u0634 \u0643\u0648\u0644\u0648\u0645\u0628\u064A\u0627. \u062D\u0642\u0648\u0642 \u0627\u0644\u0637\u0628\u0639 \u0645\u062D\u0641\u0648\u0638\u0629.", "Information on BC211": "\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0645\u0642\u062F\u0645\u0629 \u0639\u0644\u0649 BC211", "Information on HealthLinkBC (8-1-1)": "\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u062A\u062A\u0639\u0644\u0642 \u0628\u062E\u062F\u0645\u0627\u062A HealthLinkBC (811)", "Information on emergency services (9-1-1)": "\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u062A\u062A\u0639\u0644\u0642 \u0628\u062E\u062F\u0645\u0627\u062A \u0627\u0644\u0637\u0648\u0627\u0631\u0626 (911)", "Information on helplines": "\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u062A\u062A\u0639\u0644\u0642 \u0628\u062E\u0637\u0648\u0637 \u0627\u0644\u0645\u0633\u0627\u0639\u062F\u0629 \u0639\u0644\u0649 \u0627\u0644\u0647\u0627\u062A\u0641", "Learn all about B.C.": "\u062A\u0639\u0631\u0641 \u0639\u0644\u0649 \u0643\u0644 \u0634\u064A\u0621 \u0639\u0646 \u0628\u0631\u064A\u062A\u064A\u0634 \u0643\u0648\u0644\u0648\u0645\u0628\u064A\u0627.", "Mutlilingual health information services": "\u062E\u062F\u0645\u0627\u062A \u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0635\u062D\u064A\u0629 \u0645\u0642\u062F\u0645\u0629 \u0628\u0639\u062F\u0629 \u0644\u063A\u0627\u062A", "My bookmarks": "\u0639\u0644\u0627\u0645\u0627\u062A\u064A \u0627\u0644\u0645\u0631\u062C\u0639\u064A\u0629", "Next": "\u0627\u0644\u062A\u0627\u0644\u064A", "No new topics recommended based on your answers.": "\u0644\u0627 \u062A\u0648\u062C\u062F \u0645\u0648\u0627\u0636\u064A\u0639 \u062C\u062F\u064A\u062F\u0629 \u0646\u0648\u0635\u064A \u0628\u0647\u0627 \u0627\u0633\u062A\u0646\u0627\u062F\u0627 \u0625\u0644\u0649 \u0625\u062C\u0627\u0628\u0627\u062A\u0643.", "No topics to recommend": "\u0644\u0627 \u062A\u0648\u062C\u062F \u0645\u0648\u0636\u0648\u0639\u0627\u062A \u0646\u0648\u0635\u064A \u0628\u0647\u0627", "No topics to show": "\u0644\u0627 \u062A\u0648\u062C\u062F \u0645\u0648\u0636\u0648\u0639\u0627\u062A \u0643\u064A \u0646\u0639\u0631\u0636\u0647\u0627", "Number of new topics recommended based on your answers:": "\u0639\u062F\u062F \u0627\u0644\u0645\u0648\u0636\u0648\u0639\u0627\u062A \u0627\u0644\u062C\u062F\u064A\u062F\u0629 \u0627\u0644\u062A\u064A \u0646\u0648\u0635\u064A \u0628\u0647\u0627 \u0627\u0633\u062A\u0646\u0627\u062F\u0627 \u0625\u0644\u0649 \u0625\u062C\u0627\u0628\u0627\u062A\u0643:", "OF": "\u0645\u0646", "OK": "\u062D\u0633\u0646\u0627", "Once you answer some questions, your recommendations will show up below. For now, here are some topics we recommend for everyone:": "\u062D\u0627\u0644\u0645\u0627 \u0627\u0646\u062A\u0647\u064A\u062A \u0645\u0646 \u0627\u0644\u0625\u062C\u0627\u0628\u0629 \u0639\u0646 \u0628\u0636\u0639 \u0623\u0633\u0626\u0644\u0629\u060C \u0633\u0648\u0641 \u062A\u0638\u0647\u0631 \u062A\u0648\u0635\u064A\u0627\u062A\u0643 \u0627\u0644\u0645\u062E\u0635\u0635\u0629 \u062A\u0627\u0644\u064A\u0627. \u0625\u0644\u064A\u0643 \u0641\u064A \u0627\u0644\u0648\u0642\u062A \u0627\u0644\u0631\u0627\u0647\u0646 \u0628\u0639\u0636 \u0627\u0644\u0645\u0648\u0636\u0648\u0639\u0627\u062A \u0627\u0644\u062A\u064A \u0646\u0648\u0635\u064A \u0628\u0647\u0627 \u0644\u0644\u062C\u0645\u064A\u0639:", "PeaceGeeks is not liable for any damages incurred as a result of or related to the use of the app. PeaceGeeks is not an immigration consultancy network, and therefore cannot provide advice or support directly related to immigration. Arrival Advisor exists to offer newcomers a directory of services and resources to assist settlement in Metro Vancouver and does not exist in an official Immigration Service capacity.": "\u0644\u0627 \u062A\u062A\u062D\u0645\u0644 PeaceGeeks \u0627\u0644\u0645\u0633\u0624\u0648\u0644\u064A\u0629 \u0627\u0644\u0642\u0627\u0646\u0648\u0646\u064A\u0629 \u0639\u0646 \u0623\u064A \u0636\u0631\u0631 \u0645\u0627\u062F\u064A \u062D\u062F\u062B \u0646\u062A\u064A\u062C\u0629 \u0644\u0627\u0633\u062A\u062E\u062F\u0627\u0645 \u0627\u0644\u062A\u0637\u0628\u064A\u0642 \u0648\u0645\u062A\u0639\u0644\u0642 \u0628\u0627\u0633\u062A\u062E\u062F\u0627\u0645 \u0627\u0644\u062A\u0637\u0628\u064A\u0642. PeaceGeeks \u0644\u064A\u0633\u062A \u0634\u0628\u0643\u0629 \u0627\u0633\u062A\u0634\u0627\u0631\u0627\u062A \u0647\u062C\u0631\u0629 \u0648\u0628\u0627\u0644\u062A\u0627\u0644\u064A \u0644\u0627 \u064A\u0645\u0643\u0646\u0647\u0627 \u062A\u0642\u062F\u064A\u0645 \u0627\u0644\u0645\u0634\u0648\u0631\u0629 \u0623\u0648 \u0627\u0644\u0645\u0633\u0627\u0646\u062F\u0629 \u0627\u0644\u0645\u0628\u0627\u0634\u0631\u0629 \u0641\u064A \u0623\u0645\u0648\u0631 \u0627\u0644\u0647\u062C\u0631\u0629. \u0627\u0644\u063A\u0631\u0636 \u0645\u0646 Arrival Advisor \u0647\u0648 \u062A\u0642\u062F\u064A\u0645 \u062F\u0644\u064A\u0644 \u0628\u0627\u0644\u062E\u062F\u0645\u0627\u062A \u0648\u0627\u0644\u0645\u0648\u0627\u0631\u062F \u0644\u0644\u0642\u0627\u062F\u0645\u064A\u0646 \u0627\u0644\u062C\u062F\u062F \u0644\u064A\u0633\u0627\u0639\u062F\u0647\u0645 \u0641\u064A \u0627\u0644\u0627\u0633\u062A\u0642\u0631\u0627\u0631 \u0641\u064A \u0645\u062A\u0631\u0648 \u0641\u0627\u0646\u0643\u0648\u0641\u0631 \u0648\u0644\u064A\u0633 \u0627\u0644\u063A\u0631\u0636 \u0645\u0646\u0647 \u0623\u0646 \u064A\u0642\u062F\u0645 \u062E\u062F\u0645\u0627\u062A \u0647\u062C\u0631\u0629 \u0630\u0627\u062A \u0637\u0627\u0628\u0639 \u0631\u0633\u0645\u064A.", "Please ensure location services are enabled for Arrival Advisor.": "\u064A\u0631\u062C\u0649 \u0627\u0644\u062A\u0623\u0643\u062F \u0645\u0646 \u062A\u0641\u0639\u064A\u0644 \u062E\u062F\u0645\u0627\u062A \u0627\u0644\u0645\u0648\u0642\u0639 \u0644\u062A\u0637\u0628\u064A\u0642 Arrival Advisor.", "Police, fire and medical emergencies": "\u0627\u0644\u0634\u0631\u0637\u0629 \u0648\u0627\u0644\u0645\u0637\u0627\u0641\u0626 \u0648\u0627\u0644\u0637\u0648\u0627\u0631\u0626 \u0627\u0644\u0635\u062D\u064A\u0629", "Privacy policy": "\u0633\u064A\u0627\u0633\u0629 \u0627\u0644\u062E\u0635\u0648\u0635\u064A\u0629", "RELATED TOPICS": "\u0645\u0648\u0636\u0648\u0639\u0627\u062A \u0630\u0627\u062A \u0635\u0644\u0629", "Read less": "\u062A\u0642\u0644\u064A\u0644 \u0627\u0644\u0646\u0635", "Read more": "\u0632\u064A\u0627\u062F\u0629 \u0627\u0644\u0646\u0635", "Recommended for you": "\u062A\u0648\u0635\u064A\u0627\u062A \u0625\u0644\u064A\u0643", "SELECT YOUR LANGUAGE": "\u0627\u062E\u062A\u0631 \u0644\u063A\u062A\u0643", "Save important topics to build your personal plan for settlement.": "\u0627\u062D\u0641\u0638 \u0627\u0644\u0645\u0648\u0636\u0648\u0639\u0627\u062A \u0627\u0644\u0645\u0647\u0645\u0629 \u0643\u064A \u062A\u0646\u0634\u0626 \u062E\u0637\u062A\u0643 \u0644\u0644\u0627\u0633\u062A\u0642\u0631\u0627\u0631 \u0627\u0644\u0645\u062E\u0635\u0635\u0629.", "Select your language": "\u0627\u062E\u062A\u0631 \u0644\u063A\u062A\u0643", "Server version:": "\u0625\u0635\u062F\u0627\u0631 \u0631\u0642\u0645:", "Services information and referral": "\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0639\u0646 \u0627\u0644\u062E\u062F\u0645\u0627\u062A \u0648\u0625\u062D\u0627\u0644\u0627\u062A \u0625\u0644\u0649 \u062E\u062F\u0645\u0627\u062A", "Settling in Canada is now easier.": "\u0623\u0635\u0628\u062D \u0627\u0644\u0627\u0633\u062A\u0642\u0631\u0627\u0631 \u0641\u064A \u0643\u0646\u062F\u0627 \u0627\u0644\u0622\u0646 \u0623\u0633\u0647\u0644 \u0645\u0646 \u0630\u064A \u0642\u0628\u0644.", "Skip": "\u062A\u062E\u0637\u0649", "Start": "\u0627\u0628\u062F\u0623", "Start settling in B.C.": "\u0628\u062F\u0621 \u0627\u0644\u0627\u0633\u062A\u0642\u0631\u0627\u0631 \u0641\u064A \u0628\u0631\u064A\u062A\u064A\u0634 \u0643\u0648\u0644\u0648\u0645\u0628\u064A\u0627.", "Terms of Use": "\u0634\u0631\u0648\u0637 \u0627\u0644\u0627\u0633\u062A\u062E\u062F\u0627\u0645", "The Arrival Advisor app is created by PeaceGeeks in partnership with settlement organizations in Metro Vancouver, as well as immigrants and refugees like you. This project is possible thanks to funding by the Province of British Columbia and Google.org Canada in partnership with LEAP | Pecaut Centre for Social Impact. Special thanks also goes to individual donors who make this project possible. Arrival Advisor is an open-source project. You can view it on <0>GitHub</0> and <1>contact us</1> to learn how you can support this project.": "\u0635\u0645\u0645 \u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u0628\u0627\u0644\u062A\u0639\u0627\u0648\u0646 \u0645\u0639 \u0645\u0642\u062F\u0645\u064A \u062E\u062F\u0645\u0627\u062A \u0627\u0644\u0627\u0633\u062A\u0642\u0631\u0627\u0631 \u0641\u064A \u0645\u062A\u0631\u0648 \u0641\u0627\u0646\u0643\u0648\u0641\u0631 \u0648\u0645\u0647\u0627\u062C\u0631\u064A\u0646 \u0648\u0644\u0627\u062C\u0626\u064A\u0646 \u0645\u062B\u0644\u0643. \u0646\u0648\u062F \u0623\u0646 \u0646\u062A\u0648\u062C\u0647 \u0628\u0627\u0644\u0634\u0643\u0631 \u0627\u0644\u062C\u0632\u064A\u0644 \u0639\u0644\u0649 \u0627\u0644\u062F\u0639\u0645 \u0627\u0644\u0645\u0627\u0644\u064A \u0627\u0644\u0630\u064A \u0642\u062F\u0645\u062A\u0647 \u0645\u0642\u0627\u0637\u0639\u0629 \u0628\u0631\u064A\u062A\u064A\u0634 \u0643\u0648\u0644\u0648\u0645\u0628\u064A\u0627 \u0639\u0646 \u0637\u0631\u064A\u0642 \u0648\u0632\u0627\u0631\u0629 \u0627\u0644\u0648\u0638\u0627\u0626\u0641 \u0648\u0627\u0644\u062A\u062C\u0627\u0631\u0629 \u0648\u0627\u0644\u062A\u0642\u0646\u064A\u0629\u060C \u0648\u0643\u0630\u0644\u0643 Google.org Canada. \u0643\u0645\u0627 \u0646\u062A\u0648\u062C\u0647 \u0628\u0627\u0644\u0634\u0643\u0631 \u0627\u0644\u062E\u0627\u0635 \u0644\u0644\u0645\u062A\u0628\u0631\u0639\u064A\u0646 \u0645\u0646 \u0627\u0644\u0623\u0641\u0631\u0627\u062F \u0627\u0644\u0630\u064A\u0646 \u062C\u0639\u0644\u0648\u0627 \u0645\u0646 \u0647\u0630\u0627 \u0627\u0644\u0645\u0634\u0631\u0648\u0639 \u062D\u0642\u064A\u0642\u0629. \u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u0647\u0648 \u0645\u0634\u0631\u0648\u0639 \u0645\u0641\u062A\u0648\u062D \u0627\u0644\u0645\u0635\u062F\u0631. \u064A\u0645\u0643\u0646\u0643 \u0632\u064A\u0627\u0631\u0629 \u0627\u0644\u062A\u0637\u0628\u064A\u0642 \u0639\u0644\u0649 <0> GitHub</0>  \u0648\u064A\u0645\u0643\u0646\u0643 \u0623\u064A\u0636\u0627 <1>\u0627\u0644\u062A\u0648\u0627\u0635\u0644 \u0645\u0639\u0646\u0627</1> \u0643\u064A \u062A\u062A\u0639\u0631\u0641 \u0639\u0644\u0649 \u0627\u0644\u0645\u0632\u064A\u062F \u0639\u0646 \u0643\u064A\u0641\u064A\u0629 \u062A\u0642\u062F\u064A\u0645 \u0627\u0644\u062F\u0639\u0645 \u0644\u0647\u0630\u0627 \u0627\u0644\u0645\u0634\u0631\u0648\u0639.", "The app provides information about relevant newcomer services, and is intended for general guidance and reference only. While we aim to provide accurate and timely information, we do not have control over the ongoing accuracy of the information or the quality of the services provided. If you discover that a piece of information is outdated or not useful, please let us know in the feedback section of the app. The inclusion of services and resources in this app does not imply an endorsement or recommendation of those services over others.  Utilization of services located through the app is undertaken at the risk of the user.": "\u064A\u0642\u062F\u0645 \u0627\u0644\u062A\u0637\u0628\u064A\u0642 \u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0639\u0646 \u062E\u062F\u0645\u0627\u062A \u0645\u0637\u0644\u0648\u0628\u0629 \u0644\u0644\u0642\u0627\u062F\u0645\u064A\u0646 \u0627\u0644\u062C\u062F\u062F \u0648\u0627\u0644\u063A\u0631\u0636 \u0645\u0646\u0647\u0627 \u062A\u0642\u062F\u064A\u0645 \u0625\u0631\u0634\u0627\u062F\u0627\u062A \u0639\u0627\u0645\u0629 \u0648\u0623\u0646 \u062A\u0643\u0648\u0646 \u0645\u0631\u062C\u0639 \u0644\u0627 \u063A\u064A\u0631. \u0646\u0647\u062F\u0641 \u0625\u0644\u0649 \u062A\u0642\u062F\u064A\u0645 \u0645\u0639\u0644\u0648\u0645\u0627\u062A \u062F\u0642\u064A\u0642\u0629 \u0648\u0633\u0631\u064A\u0639\u0629 \u0625\u0644\u0627 \u0623\u0646\u0646\u0627 \u0644\u0627 \u0646\u062A\u062D\u0643\u0645 \u0641\u064A \u062F\u0642\u0629 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0623\u0648 \u0645\u0633\u062A\u0648\u0649 \u062C\u0648\u062F\u0629 \u0627\u0644\u062E\u062F\u0645\u0627\u062A \u0627\u0644\u0645\u0642\u062F\u0645\u0629. \u0644\u0648 \u0627\u0643\u062A\u0634\u0641\u062A \u0623\u0646 \u0623\u064A \u0645\u0646 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0623\u0635\u0628\u062D \u0642\u062F\u064A\u0645 \u0623\u0648 \u063A\u064A\u0631 \u0645\u0641\u064A\u062F\u060C \u064A\u0631\u062C\u0649 \u0625\u0628\u0644\u0627\u063A\u0646\u0627 \u0628\u0630\u0644\u0643 \u0641\u064A \u0642\u0633\u0645 \u0627\u0644\u0622\u0631\u0627\u0621 \u0648\u0627\u0644\u0645\u0644\u0627\u062D\u0638\u0627\u062A \u0627\u0644\u062E\u0627\u0635 \u0628\u0627\u0644\u062A\u0637\u0628\u064A\u0642. \u0644\u0627 \u064A\u0639\u0646\u064A \u0648\u062C\u0648\u062F \u0627\u0644\u062E\u062F\u0645\u0627\u062A \u0641\u064A \u0647\u0630\u0627 \u0627\u0644\u062A\u0637\u0628\u064A\u0642 \u062A\u0635\u062F\u064A\u0642\u0627 \u0623\u0648 \u062A\u0648\u0635\u064A\u0629 \u0644\u0647\u0630\u0647 \u0627\u0644\u062E\u062F\u0645\u0627\u062A \u062F\u0648\u0646 \u063A\u064A\u0631\u0647\u0627. \u0643\u0645\u0627 \u0623\u0646 \u0645\u0633\u0624\u0648\u0644\u064A\u0629 \u0627\u0644\u0627\u0633\u062A\u0639\u0627\u0646\u0629 \u0628\u0627\u0644\u062E\u062F\u0645\u0627\u062A \u0627\u0644\u062A\u064A \u0648\u062C\u062F\u062A\u0647\u0627 \u0645\u0633\u062A\u062E\u062F\u0645\u0627 \u0647\u0630\u0627 \u0627\u0644\u062A\u0637\u0628\u064A\u0642 \u064A\u0642\u0639 \u0639\u0644\u0649 \u0627\u0644\u0645\u0633\u062A\u062E\u062F\u0645.", "This is Arrival Advisor version:": "\u0647\u0630\u0627 \u0627\u0644\u0625\u0635\u062F\u0627\u0631 \u0645\u0646 \u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u0647\u0648:", "UPDATE MY RECOMMENDATIONS": "\u062A\u062D\u062F\u064A\u062B \u062A\u0648\u0635\u064A\u0627\u062A\u064A", "Do you want to delete all user data from this phone? This includes which answers are chosen in the questionnaire and which topics are bookmarked.": "\u0647\u0644 \u062A\u0631\u064A\u062F \u062D\u0630\u0641 \u062C\u0645\u064A\u0639 \u0628\u064A\u0627\u0646\u0627\u062A \u0627\u0644\u0645\u0633\u062A\u062E\u062F\u0645 \u0645\u0646 \u0647\u0630\u0627 \u0627\u0644\u0647\u0627\u062A\u0641\u061F \u064A\u062A\u0636\u0645\u0646 \u0630\u0644\u0643 \u0625\u062C\u0627\u0628\u0627\u062A \u0627\u0644\u0627\u0633\u062A\u0628\u064A\u0627\u0646 \u0648\u0627\u0644\u0645\u0648\u0636\u0648\u0639\u0627\u062A \u0627\u0644\u062A\u064A \u062A\u0645 \u0627\u062E\u062A\u064A\u0627\u0631\u0647\u0627.", "Cancel": "\u0625\u0644\u063A\u0627\u0621", "Open in maps": "\u0641\u062A\u062D \u0641\u064A \u0627\u0644\u062E\u0631\u0627\u0626\u0637", "Address:": "\u0627\u0644\u0639\u0646\u0648\u0627\u0646:", "FIND A SERVICE NEAR YOU": "\u0627\u0628\u062D\u062B \u0639\u0646 \u062E\u062F\u0645\u0629 \u0628\u0627\u0644\u0642\u0631\u0628 \u0645\u0646\u0643", "Email:": "\u0627\u0644\u0628\u0631\u064A\u062F \u0627\u0644\u0625\u0644\u0643\u062A\u0631\u0648\u0646\u064A:", "Web:": "\u0627\u0644\u0645\u0648\u0642\u0639 \u0627\u0644\u0634\u0628\u0643\u064A:", "How long have you been living in Canada?": "\u0643\u0645 \u0645\u0636\u0649 \u0639\u0644\u064A\u0643 \u0645\u0646 \u0627\u0644\u0648\u0642\u062A \u0645\u0642\u064A\u0645\u0627 \u0641\u064A \u0643\u0646\u062F\u0627\u061F", "More than 1 year": "\u0623\u0643\u062B\u0631 \u0645\u0646 \u0633\u0646\u0629 \u0648\u0627\u062D\u062F\u0629", "Less than 1 year": "\u0623\u0642\u0644 \u0645\u0646 \u0633\u0646\u0629 \u0648\u0627\u062D\u062F\u0629", "I am planning to move to Canada": "\u0623\u0639\u062A\u0632\u0645 \u0627\u0644\u0627\u0646\u062A\u0642\u0627\u0644 \u0625\u0644\u0649 \u0643\u0646\u062F\u0627", "Do you have any of the following important Canadian documents?": "\u0647\u0644 \u0644\u062F\u064A\u0643 \u0623\u064A \u0645\u0646 \u0627\u0644\u0648\u062B\u0627\u0626\u0642 \u0627\u0644\u0643\u0646\u062F\u064A\u0629 \u0627\u0644\u0647\u0627\u0645\u0629 \u0627\u0644\u062A\u0627\u0644\u064A\u0629\u061F", "I have a Social Insurance Number": "\u0644\u062F\u064A \u0631\u0642\u0645 \u0636\u0645\u0627\u0646 \u0627\u062C\u062A\u0645\u0627\u0639\u064A", "I have a Canadian bank account": "\u0644\u062F\u064A \u062D\u0633\u0627\u0628 \u0645\u0635\u0631\u0641\u064A \u0643\u0646\u062F\u064A", "I have a Permanent Resident Card": "\u0644\u062F\u064A \u0628\u0637\u0627\u0642\u0629 \u0645\u0642\u064A\u0645 \u062F\u0627\u0626\u0645", "I have registered for MSP (Medical Services Plan)": "\u0644\u0642\u062F \u0633\u062C\u0644\u062A \u0646\u0641\u0633\u064A \u0641\u064A \u062E\u0637\u0629 \u0627\u0644\u062E\u062F\u0645\u0627\u062A \u0627\u0644\u0637\u0628\u064A\u0629 (Medical Services Plan)", "I have a BC Services Card (health card)": "\u0644\u062F\u064A \u0628\u0637\u0627\u0642\u0629 \u062E\u062F\u0645\u0627\u062A \u0628\u0631\u064A\u062A\u064A\u0634 \u0643\u0648\u0644\u0648\u0645\u0628\u064A\u0627 (\u0627\u0644\u0628\u0637\u0627\u0642\u0629 \u0627\u0644\u0635\u062D\u064A\u0629)", "I have a BC Driver's Licence": "\u0644\u062F\u064A \u0631\u062E\u0635\u0629 \u0642\u064A\u0627\u062F\u0629 \u062E\u0627\u0635\u0629 \u0628\u0628\u0631\u064A\u062A\u064A\u0634 \u0643\u0648\u0644\u0648\u0645\u0628\u064A\u0627", "Are you arriving with children under 18 years? If yes, how old?": "\u0647\u0644 \u0648\u0635\u0644\u062A \u0645\u0639\u0643 \u0623\u0637\u0641\u0627\u0644 \u0623\u0642\u0644 \u0645\u0646 18 \u0633\u0646\u0629\u061F \u0644\u0648 \u0643\u0627\u0646\u062A \u0627\u0644\u0625\u062C\u0627\u0628\u0629 \u0646\u0639\u0645\u060C \u0643\u0645 \u0639\u0645\u0631\u0647\u0645\u061F", "Under 5 years old": "\u0623\u0642\u0644 \u0645\u0646 5 \u0633\u0646\u0648\u0627\u062A", "5-12 years old": "\u0645\u0646 5 \u0625\u0644\u0649 12 \u0633\u0646\u0629", "13-18 years old": "\u0645\u0646 13 \u0625\u0644\u0649 18 \u0633\u0646\u0629", "Pregnant (the child is not yet born)": "\u062D\u0628\u0644\u0649 (\u0644\u0645 \u064A\u0648\u0644\u062F \u0628\u0639\u062F)", "No children": "\u0644\u0627 \u064A\u0648\u062C\u062F \u0623\u0637\u0641\u0627\u0644", "What is your current housing situation?": "\u0645\u0627 \u0647\u0648 \u0645\u0648\u0642\u0641\u0643 \u0627\u0644\u062D\u0627\u0644\u064A \u0645\u0646 \u0627\u0644\u0633\u0643\u0646\u061F", "I want to rent a place to live": "\u0623\u0631\u063A\u0628 \u0641\u064A \u062A\u0623\u062C\u064A\u0631 \u0645\u0633\u0643\u0646", "I want to buy a home": "\u0623\u0631\u063A\u0628 \u0641\u064A \u0634\u0631\u0627\u0621 \u0645\u0646\u0632\u0644", "I am already renting a home": "\u0644\u0642\u062F \u0627\u0633\u062A\u0623\u062C\u0631\u062A \u0645\u0633\u0643\u0646 \u0628\u0627\u0644\u0641\u0639\u0644", "I already own a home": "\u0623\u0645\u0644\u0643 \u0645\u0646\u0632\u0644 \u0628\u0627\u0644\u0641\u0639\u0644", "What is your current level of English?": "\u0645\u0627 \u0647\u0648 \u0645\u0633\u062A\u0648\u0649 \u0625\u062C\u0627\u062F\u062A\u0643 \u0627\u0644\u062D\u0627\u0644\u064A \u0644\u0644\u063A\u0629 \u0627\u0644\u0625\u0646\u0643\u0644\u064A\u0632\u064A\u0629\u061F", "None": "\u0644\u0627 \u0634\u064A\u0621", "Beginner (Canadian Language Benchmarks 1-4)": "\u0645\u0628\u062A\u062F\u0626 (\u0628\u064A\u0646 1 \u06484 \u0639\u0644\u0649 \u0627\u0644\u0645\u0639\u064A\u0627\u0631 \u0627\u0644\u0643\u0646\u062F\u064A \u0644\u0644\u063A\u0629)", "Intermediate (Canadian Language Benchmarks 5-8)": "\u0645\u062A\u0648\u0633\u0637 (\u0628\u064A\u0646 5 \u06488 \u0639\u0644\u0649 \u0627\u0644\u0645\u0639\u064A\u0627\u0631 \u0627\u0644\u0643\u0646\u062F\u064A \u0644\u0644\u063A\u0629)", "Fluent (Canadian Language Benchmarks 9-12)": "\u0641\u0635\u064A\u062D (\u0628\u064A\u0646 9 \u064812 \u0639\u0644\u0649 \u0627\u0644\u0645\u0639\u064A\u0627\u0631 \u0627\u0644\u0643\u0646\u062F\u064A \u0644\u0644\u063A\u0629)", "What is your status in Canada?": "\u0645\u0627 \u0647\u0648 \u0648\u0636\u0639\u0643 \u0641\u064A \u0643\u0646\u062F\u0627\u061F", "Permanent resident": "\u0645\u0642\u064A\u0645 \u062F\u0627\u0626\u0645", "Permanent Resident - Refugee Class or Protected Person": "\u0645\u0642\u064A\u0645 \u062F\u0627\u0626\u0645 \u2013 \u0641\u0626\u0629 \u0644\u0627\u062C\u0626 \u0623\u0648 \u0645\u062A\u0645\u062A\u0639 \u0628\u0627\u0644\u062D\u0645\u0627\u064A\u0629", "Refugee claimant": "\u0637\u0627\u0644\u0628 \u0644\u062C\u0648\u0621", "Temporary Foreign Worker": "\u0639\u0627\u0645\u0644 \u0623\u062C\u0646\u0628\u064A \u0645\u0624\u0642\u062A", "Student visa": "\u062A\u0623\u0634\u064A\u0631\u0629 \u0637\u0627\u0644\u0628", "Other": "\u0623\u062E\u0631\u0649", "What is your current work situation?": "\u0645\u0627 \u0647\u0648 \u0648\u0636\u0639\u0643 \u0627\u0644\u062D\u0627\u0644\u064A \u0645\u0646 \u0646\u0627\u062D\u064A\u0629 \u0627\u0644\u0639\u0645\u0644\u061F", "I am looking for work": "\u0623\u0628\u062D\u062B \u0639\u0646 \u0639\u0645\u0644", "I want to learn about my rights at work": "\u0623\u0631\u063A\u0628 \u0641\u064A \u0627\u0644\u062A\u0639\u0631\u0641 \u0639\u0644\u0649 \u0627\u0644\u0645\u0632\u064A\u062F \u0639\u0646 \u062D\u0642\u0648\u0642\u064A \u0641\u064A \u0645\u0643\u0627\u0646 \u0627\u0644\u0639\u0645\u0644", "I have my own business or want to start my own business": "\u0623\u0645\u0644\u0643 \u0646\u0634\u0627\u0637\u064A \u0627\u0644\u062A\u062C\u0627\u0631\u064A \u0627\u0644\u062E\u0627\u0635 \u0623\u0648 \u0623\u0631\u063A\u0628 \u0641\u064A \u062A\u0623\u0633\u064A\u0633 \u0646\u0634\u0627\u0637\u064A \u0627\u0644\u062A\u062C\u0627\u0631\u064A", "What kinds of health care are you looking for?": "\u0645\u0627 \u0647\u064A \u0623\u0646\u0648\u0627\u0639 \u0627\u0644\u0631\u0639\u0627\u064A\u0629 \u0627\u0644\u0635\u062D\u064A\u0629 \u0627\u0644\u062A\u064A \u062A\u0628\u062D\u062B \u0639\u0646\u0647\u0627\u061F", "General health care and learning about health care costs": "\u0631\u0639\u0627\u064A\u0629 \u0635\u062D\u064A\u0629 \u0639\u0627\u0645\u0629 \u0648\u0627\u0644\u062A\u0639\u0631\u0641 \u0639\u0644\u0649 \u062A\u0643\u0644\u0641\u0629 \u0627\u0644\u0631\u0639\u0627\u064A\u0629 \u0627\u0644\u0635\u062D\u064A\u0629", "I need urgent medical attention (for emergencies, call 9-1-1)": "\u0623\u0631\u064A\u062F \u0631\u0639\u0627\u064A\u0629 \u0635\u062D\u064A\u0629 \u0639\u0627\u062C\u0644\u0629 (\u0641\u064A \u062D\u0627\u0644\u0627\u062A \u0627\u0644\u0637\u0648\u0627\u0631\u0626\u060C \u0627\u062A\u0635\u0644 \u0628\u0627\u0644\u0631\u0642\u0645 911)", "Prescription medication": "\u0623\u062F\u0648\u064A\u0629 \u062A\u0635\u0631\u0641 \u0628\u0648\u0635\u0641\u0629 \u0637\u0628\u064A\u0629", "Mental health support": "\u0645\u0633\u0627\u0639\u062F\u0629 \u062E\u0627\u0635\u0629 \u0628\u0627\u0644\u0635\u062D\u0629 \u0627\u0644\u0646\u0641\u0633\u064A\u0629", "Eye doctors": "\u0637\u0628\u064A\u0628 \u0639\u064A\u0648\u0646", "Dentists": "\u0637\u0628\u064A\u0628 \u0623\u0633\u0646\u0627\u0646", "Support for disabilities": "\u0645\u0633\u0627\u0639\u062F\u0629 \u0645\u0648\u062C\u0647\u0629 \u0644\u0623\u0635\u062D\u0627\u0628 \u0627\u0644\u0627\u062D\u062A\u064A\u0627\u062C\u0627\u062A \u0627\u0644\u062E\u0627\u0635\u0629", "Do you need financial assistance or low-income support?": "\u0647\u0644 \u062A\u0631\u064A\u062F \u0645\u0633\u0627\u0639\u062F\u0629 \u0645\u0627\u0644\u064A\u0629 \u0623\u0648 \u062F\u0639\u0645 \u0645\u0648\u062C\u0647 \u0644\u0623\u0635\u062D\u0627\u0628 \u0627\u0644\u062F\u062E\u0644 \u0627\u0644\u0645\u062A\u062F\u0646\u064A\u061F", "Yes": "\u0646\u0639\u0645", "No": "\u0644\u0627", "I have low income support": "\u0623\u062D\u0635\u0644 \u0639\u0644\u0649 \u062F\u0639\u0645 \u0645\u0648\u062C\u0647 \u0644\u0623\u0635\u062D\u0627\u0628 \u0627\u0644\u062F\u062E\u0644 \u0627\u0644\u0645\u062D\u062F\u0648\u062F", "Anything else you're interested in? Select all that apply": "\u0647\u0644 \u064A\u0648\u062C\u062F \u0634\u064A\u0621 \u0622\u062E\u0631 \u064A\u0647\u0645\u0643\u061F \u0627\u062E\u062A\u0631 \u0643\u0644 \u0645\u0627 \u064A\u0646\u0637\u0628\u0642", "Adult education and training": "\u062A\u0639\u0644\u064A\u0645 \u0627\u0644\u0643\u0628\u0627\u0631 \u0648\u062A\u062F\u0631\u064A\u0628\u0647\u0645", "Becoming a Canadian citizen": "\u0623\u0646 \u0623\u0635\u0628\u062D \u0645\u0648\u0627\u0637\u0646\u0627 \u0643\u0646\u062F\u064A\u0627", "Legal help": "\u0645\u0633\u0627\u0639\u062F\u0629 \u0642\u0627\u0646\u0648\u0646\u064A\u0629", "Banking and financial management": "\u0623\u0645\u0648\u0631 \u0645\u0635\u0631\u0641\u064A\u0629 \u0648\u0625\u062F\u0627\u0631\u0629 \u0627\u0644\u0623\u0645\u0648\u0627\u0644", "Taxes": "\u0627\u0644\u0636\u0631\u0627\u0626\u0628", "LGBTQ2 services": "\u062E\u062F\u0645\u0627\u062A LGBTQ2", "Francophone services": "\u062E\u062F\u0645\u0627\u062A \u0644\u0644\u0646\u0627\u0637\u0642\u064A\u0646 \u0628\u0627\u0644\u0644\u063A\u0629 \u0627\u0644\u0641\u0631\u0646\u0633\u064A\u0629", "Support for seniors (age 65+)": "\u0645\u0633\u0627\u0646\u062F\u0629 \u0645\u0648\u062C\u0647\u0629 \u0644\u0643\u0628\u0627\u0631 \u0627\u0644\u0633\u0646 (\u0623\u0643\u0628\u0631 \u0645\u0646 65 \u0633\u0646\u0629)", "Driving in BC": "\u0627\u0644\u0642\u064A\u0627\u062F\u0629 \u0641\u064A \u0628\u0631\u064A\u062A\u064A\u0634 \u0643\u0648\u0644\u0648\u0645\u0628\u064A\u0627", "Public transportation": "\u0627\u0644\u0645\u0648\u0627\u0635\u0644\u0627\u062A \u0627\u0644\u0639\u0627\u0645\u0629", "Help with abuse and violence": "\u0645\u0633\u0627\u0639\u062F\u0629 \u0645\u062A\u0639\u0644\u0642\u0629 \u0628\u0627\u0644\u0639\u0646\u0641 \u0648\u0627\u0644\u0625\u0633\u0627\u0621\u0629", "Community services and organizations": "\u062E\u062F\u0645\u0627\u062A \u0627\u0644\u0645\u062C\u062A\u0645\u0639 \u0648\u0645\u0646\u0638\u0645\u0627\u062A \u0627\u0644\u0645\u062C\u062A\u0645\u0639 \u0627\u0644\u0645\u062F\u0646\u064A", "Things to do right away": "\u0623\u0645\u0648\u0631 \u064A\u062C\u0628 \u0639\u0645\u0644\u0647\u0627 \u0639\u0644\u0649 \u0627\u0644\u0641\u0648\u0631", "Settling in": "\u062A\u0633\u062A\u0642\u0631 \u0641\u064A", "Education": "\u0627\u0644\u062A\u0639\u0644\u064A\u0645", "Health care": "\u0627\u0644\u0631\u0639\u0627\u064A\u0629 \u0627\u0644\u0635\u062D\u064A\u0629", "Money & banking": "\u0627\u0644\u0645\u0627\u0644 \u0648\u0627\u0644\u0628\u0646\u0648\u0643", "Housing": "\u0627\u0644\u0625\u0633\u0643\u0627\u0646", "Employment": "\u062A\u0648\u0638\u064A\u0641", "Legal system & immigration": "\u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u0642\u0627\u0646\u0648\u0646\u064A \u0648\u0627\u0644\u0647\u062C\u0631\u0629", "Driving": "\u0627\u0644\u0642\u064A\u0627\u062F\u0629", "Help for individuals & families": "\u0645\u0633\u0627\u0639\u062F\u0629 \u0644\u0644\u0623\u0641\u0631\u0627\u062F \u0648\u0627\u0644\u0639\u0627\u0626\u0644\u0627\u062A", "Important tasks for settling in your community": "\u0645\u0647\u0627\u0645 \u0644\u0627 \u063A\u0646\u0649 \u0639\u0646\u0647\u0627 \u0646\u062D\u0648 \u0627\u0644\u0627\u0633\u062A\u0642\u0631\u0627\u0631 \u0641\u064A \u0645\u062C\u062A\u0645\u0639\u0643", "Social customs and getting around your community": "\u0627\u0644\u0639\u0627\u062F\u0627\u062A \u0627\u0644\u0627\u062C\u062A\u0645\u0627\u0639\u064A\u0629 \u0648\u0627\u0644\u062A\u0646\u0642\u0644 \u062F\u0627\u062E\u0644 \u0645\u062C\u062A\u0645\u0639\u0643", "Learning English, schools for children, youth and adults": "\u062A\u0639\u0644\u0645 \u0627\u0644\u0644\u063A\u0629 \u0627\u0644\u0625\u0646\u062C\u0644\u064A\u0632\u064A\u0629 \u0648\u0627\u0644\u0645\u062F\u0627\u0631\u0633 \u0644\u0644\u0623\u0637\u0641\u0627\u0644 \u0648\u0644\u0644\u0634\u0628\u0627\u0628 \u0648\u0644\u0644\u0643\u0628\u0627\u0631", "Medical insurance, finding a doctor, mental health": "\u0627\u0644\u062A\u0623\u0645\u064A\u0646 \u0627\u0644\u0637\u0628\u064A \u0648\u0627\u0644\u0628\u062D\u062B \u0639\u0646 \u0637\u0628\u064A\u0628 \u0648\u0627\u0644\u0635\u062D\u0629 \u0627\u0644\u0646\u0641\u0633\u064A\u0629", "Opening a bank account, filing taxes": "\u0641\u062A\u062D \u062D\u0633\u0627\u0628 \u0645\u0635\u0631\u0641\u064A \u0648\u062A\u0642\u062F\u064A\u0645 \u0627\u0644\u0625\u0642\u0631\u0627\u0631 \u0627\u0644\u0636\u0631\u064A\u0628\u064A", "Finding a place to rent or buy, getting rental assistance": "\u0625\u064A\u062C\u0627\u062F \u0645\u0633\u0643\u0646 \u0644\u0644\u0625\u064A\u062C\u0627\u0631 \u0623\u0648 \u0627\u0644\u062A\u0645\u0644\u0643 \u0648\u0627\u0644\u062D\u0635\u0648\u0644 \u0639\u0644\u0649 \u062F\u0639\u0645 \u0641\u064A \u0633\u062F\u0627\u062F \u0627\u0644\u0625\u064A\u062C\u0627\u0631", "Finding a job, working and workers\u2019 rights": "\u0627\u0644\u0628\u062D\u062B \u0639\u0646 \u0648\u0638\u064A\u0641\u0629 \u0648\u0627\u0644\u0639\u0645\u0644 \u0648\u062D\u0642\u0648\u0642 \u0627\u0644\u0639\u0627\u0645\u0644\u064A\u0646", "Immigration and citizenship, legal support, police": "\u0627\u0644\u0647\u062C\u0631\u0629 \u0648\u0627\u0644\u062C\u0646\u0633\u064A\u0629 \u0648\u0627\u0644\u062F\u0639\u0645 \u0627\u0644\u0642\u0627\u0646\u0648\u0646\u064A \u0648\u0627\u0644\u0634\u0631\u0637\u0629", "Getting a driver's licence, traffic laws, basic insurance": "\u0627\u0644\u062D\u0635\u0648\u0644 \u0639\u0644\u0649 \u0631\u062E\u0635\u0629 \u0627\u0644\u0642\u064A\u0627\u062F\u0629 \u0648\u0642\u0648\u0627\u0646\u064A\u0646 \u0627\u0644\u0645\u0631\u0648\u0631 \u0648\u0627\u0644\u062A\u0623\u0645\u064A\u0646 \u0627\u0644\u0623\u0633\u0627\u0633\u064A", "For example low-income, disabilities, youth": "\u0639\u0644\u0649 \u0633\u0628\u064A\u0644 \u0627\u0644\u0645\u062B\u0627\u0644 \u0630\u0648\u064A \u0627\u0644\u062F\u062E\u0644 \u0627\u0644\u0645\u062D\u062F\u0648\u062F \u0648\u0630\u0648\u064A \u0627\u0644\u0627\u062D\u062A\u064A\u0627\u062C\u0627\u062A \u0627\u0644\u062E\u0627\u0635\u0629 \u0648\u0627\u0644\u0634\u0628\u0627\u0628", "THINGS TO DO RIGHT AWAY": "\u0623\u0645\u0648\u0631 \u064A\u062C\u0628 \u0639\u0645\u0644\u0647\u0627 \u0639\u0644\u0649 \u0627\u0644\u0641\u0648\u0631", "SETTLING IN": "\u062A\u0633\u062A\u0642\u0631 \u0641\u064A", "EDUCATION": "\u0627\u0644\u062A\u0639\u0644\u064A\u0645", "HEALTH CARE": "\u0627\u0644\u0631\u0639\u0627\u064A\u0629 \u0627\u0644\u0635\u062D\u064A\u0629", "MONEY & BANKING": "\u0627\u0644\u0645\u0627\u0644 \u0648\u0627\u0644\u0628\u0646\u0648\u0643", "HOUSING": "\u0627\u0644\u0625\u0633\u0643\u0627\u0646", "EMPLOYMENT": "\u062A\u0648\u0638\u064A\u0641", "LEGAL SYSTEM & IMMIGRATION": "\u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u0642\u0627\u0646\u0648\u0646\u064A \u0648\u0627\u0644\u0647\u062C\u0631\u0629", "DRIVING": "\u0627\u0644\u0642\u064A\u0627\u062F\u0629", "HELP FOR INDIVIDUALS & FAMILIES": "\u0645\u0633\u0627\u0639\u062F\u0629 \u0644\u0644\u0623\u0641\u0631\u0627\u062F \u0648\u0627\u0644\u0639\u0627\u0626\u0644\u0627\u062A", "IMPORTANT TASKS FOR SETTLING IN YOUR COMMUNITY": "\u0645\u0647\u0627\u0645 \u0644\u0627 \u063A\u0646\u0649 \u0639\u0646\u0647\u0627 \u0646\u062D\u0648 \u0627\u0644\u0627\u0633\u062A\u0642\u0631\u0627\u0631 \u0641\u064A \u0645\u062C\u062A\u0645\u0639\u0643", "SOCIAL CUSTOMS AND GETTING AROUND YOUR COMMUNITY": "\u0627\u0644\u0639\u0627\u062F\u0627\u062A \u0627\u0644\u0627\u062C\u062A\u0645\u0627\u0639\u064A\u0629 \u0648\u0627\u0644\u062A\u0646\u0642\u0644 \u062F\u0627\u062E\u0644 \u0645\u062C\u062A\u0645\u0639\u0643", "LEARNING ENGLISH, SCHOOLS FOR CHILDREN, YOUTH AND ADULTS": "\u062A\u0639\u0644\u0645 \u0627\u0644\u0644\u063A\u0629 \u0627\u0644\u0625\u0646\u062C\u0644\u064A\u0632\u064A\u0629 \u0648\u0627\u0644\u0645\u062F\u0627\u0631\u0633 \u0644\u0644\u0623\u0637\u0641\u0627\u0644 \u0648\u0644\u0644\u0634\u0628\u0627\u0628 \u0648\u0644\u0644\u0643\u0628\u0627\u0631", "MEDICAL INSURANCE, FINDING A DOCTOR, MENTAL HEALTH": "\u0627\u0644\u062A\u0623\u0645\u064A\u0646 \u0627\u0644\u0637\u0628\u064A \u0648\u0627\u0644\u0628\u062D\u062B \u0639\u0646 \u0637\u0628\u064A\u0628 \u0648\u0627\u0644\u0635\u062D\u0629 \u0627\u0644\u0646\u0641\u0633\u064A\u0629", "OPENING A BANK ACCOUNT, FILING TAXES": "\u0641\u062A\u062D \u062D\u0633\u0627\u0628 \u0645\u0635\u0631\u0641\u064A \u0648\u062A\u0642\u062F\u064A\u0645 \u0627\u0644\u0625\u0642\u0631\u0627\u0631 \u0627\u0644\u0636\u0631\u064A\u0628\u064A", "FINDING A PLACE TO RENT OR BUY, GETTING RENTAL ASSISTANCE": "\u0625\u064A\u062C\u0627\u062F \u0645\u0633\u0643\u0646 \u0644\u0644\u0625\u064A\u062C\u0627\u0631 \u0623\u0648 \u0627\u0644\u062A\u0645\u0644\u0643 \u0648\u0627\u0644\u062D\u0635\u0648\u0644 \u0639\u0644\u0649 \u062F\u0639\u0645 \u0641\u064A \u0633\u062F\u0627\u062F \u0627\u0644\u0625\u064A\u062C\u0627\u0631", "FINDING A JOB, WORKING AND WORKERS\u2019 RIGHTS": "\u0627\u0644\u0628\u062D\u062B \u0639\u0646 \u0648\u0638\u064A\u0641\u0629 \u0648\u0627\u0644\u0639\u0645\u0644 \u0648\u062D\u0642\u0648\u0642 \u0627\u0644\u0639\u0627\u0645\u0644\u064A\u0646", "IMMIGRATION AND CITIZENSHIP, LEGAL SUPPORT, POLICE": "\u0627\u0644\u0647\u062C\u0631\u0629 \u0648\u0627\u0644\u062C\u0646\u0633\u064A\u0629 \u0648\u0627\u0644\u062F\u0639\u0645 \u0627\u0644\u0642\u0627\u0646\u0648\u0646\u064A \u0648\u0627\u0644\u0634\u0631\u0637\u0629", "GETTING A DRIVER'S LICENCE, TRAFFIC LAWS, BASIC INSURANCE": "\u0627\u0644\u062D\u0635\u0648\u0644 \u0639\u0644\u0649 \u0631\u062E\u0635\u0629 \u0627\u0644\u0642\u064A\u0627\u062F\u0629 \u0648\u0642\u0648\u0627\u0646\u064A\u0646 \u0627\u0644\u0645\u0631\u0648\u0631 \u0648\u0627\u0644\u062A\u0623\u0645\u064A\u0646 \u0627\u0644\u0623\u0633\u0627\u0633\u064A", "FOR EXAMPLE LOW-INCOME, DISABILITIES, YOUTH": "\u0639\u0644\u0649 \u0633\u0628\u064A\u0644 \u0627\u0644\u0645\u062B\u0627\u0644 \u0630\u0648\u064A \u0627\u0644\u062F\u062E\u0644 \u0627\u0644\u0645\u062D\u062F\u0648\u062F \u0648\u0630\u0648\u064A \u0627\u0644\u0627\u062D\u062A\u064A\u0627\u062C\u0627\u062A \u0627\u0644\u062E\u0627\u0635\u0629 \u0648\u0627\u0644\u0634\u0628\u0627\u0628", "The Arrival Advisor app is created by PeaceGeeks in partnership with settlement organizations in Metro Vancouver, as well as immigrants and refugees like you. This project is possible thanks to funding by the Province of British Columbia and Google.org Canada in partnership with LEAP | Pecaut Centre for Social Impact. Special thanks also goes to individual donors who make this project possible. Arrival Advisor is an open-source project. You can <0>view it on GitHub</0> and <1>contact us</1> to learn how you can support this project.": "\u0635\u0645\u0645 \u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u0628\u0627\u0644\u062A\u0639\u0627\u0648\u0646 \u0645\u0639 \u0645\u0642\u062F\u0645\u064A \u062E\u062F\u0645\u0627\u062A \u0627\u0644\u0627\u0633\u062A\u0642\u0631\u0627\u0631 \u0641\u064A \u0645\u062A\u0631\u0648 \u0641\u0627\u0646\u0643\u0648\u0641\u0631 \u0648\u0645\u0647\u0627\u062C\u0631\u064A\u0646 \u0648\u0644\u0627\u062C\u0626\u064A\u0646 \u0645\u062B\u0644\u0643. \u0646\u0648\u062F \u0623\u0646 \u0646\u062A\u0648\u062C\u0647 \u0628\u0627\u0644\u0634\u0643\u0631 \u0627\u0644\u062C\u0632\u064A\u0644 \u0639\u0644\u0649 \u0627\u0644\u062F\u0639\u0645 \u0627\u0644\u0645\u0627\u0644\u064A \u0627\u0644\u0630\u064A \u0642\u062F\u0645\u062A\u0647 \u0645\u0642\u0627\u0637\u0639\u0629 \u0628\u0631\u064A\u062A\u064A\u0634 \u0643\u0648\u0644\u0648\u0645\u0628\u064A\u0627 \u0639\u0646 \u0637\u0631\u064A\u0642 \u0648\u0632\u0627\u0631\u0629 \u0627\u0644\u0648\u0638\u0627\u0626\u0641 \u0648\u0627\u0644\u062A\u062C\u0627\u0631\u0629 \u0648\u0627\u0644\u062A\u0642\u0646\u064A\u0629\u060C \u0648\u0643\u0630\u0644\u0643 Google.org Canada. \u0643\u0645\u0627 \u0646\u062A\u0648\u062C\u0647 \u0628\u0627\u0644\u0634\u0643\u0631 \u0627\u0644\u062E\u0627\u0635 \u0644\u0644\u0645\u062A\u0628\u0631\u0639\u064A\u0646 \u0645\u0646 \u0627\u0644\u0623\u0641\u0631\u0627\u062F \u0627\u0644\u0630\u064A\u0646 \u062C\u0639\u0644\u0648\u0627 \u0645\u0646 \u0647\u0630\u0627 \u0627\u0644\u0645\u0634\u0631\u0648\u0639 \u062D\u0642\u064A\u0642\u0629. \u062A\u0637\u0628\u064A\u0642 Arrival Advisor \u0647\u0648 \u0645\u0634\u0631\u0648\u0639 \u0645\u0641\u062A\u0648\u062D \u0627\u0644\u0645\u0635\u062F\u0631. \u064A\u0645\u0643\u0646\u0643 \u0632\u064A\u0627\u0631\u0629 <0>view it on GitHub</0> \u0648\u0643\u0630\u0644\u0643 \u0645\u0631\u0627\u0633\u0644\u0629 <1>\u0627\u0644\u062A\u0648\u0627\u0635\u0644 \u0645\u0639\u0646\u0627</1> \u0643\u064A \u062A\u062A\u0639\u0631\u0641 \u0639\u0644\u0649 \u0627\u0644\u0645\u0632\u064A\u062F \u0639\u0646 \u0643\u064A\u0641\u064A\u0629 \u062A\u0642\u062F\u064A\u0645 \u0627\u0644\u0645\u0633\u0627\u0646\u062F\u0629 \u0644\u0647\u0630\u0627 \u0627\u0644\u0645\u0634\u0631\u0648\u0639." } };
